Transaction.Events:
Event Start
	/* Generated by Work With Pattern [Start] - Do not change */
	[web]
	{
	PLoadContext.Call(&Context)
    PIsAuthorized.Call(&Pgmname, &IsAuthorized)
    If &IsAuthorized = Boolean.False
        HNotAuthorized.Call(&Pgmname)
    Endif

    // Prepare for insert
    If (&Mode = TrnMode.Insert)
        &TrnContext.FromXml(&Session.Get(!"TrnContext"))
        If (&TrnContext.TransactionName = &Pgmname)
            For &TrnContextAtt in &TrnContext.Attributes
                Do Case
                    // When inserting with instantiated CONCCod
                    Case &TrnContextAtt.AttributeName = !"CONCCod"
                        &Insert_CONCCod.FromString(&TrnContextAtt.AttributeValue)
                    // When inserting with instantiated MONECod
                    Case &TrnContextAtt.AttributeName = !"MONECod"
                        &Insert_MONECod.FromString(&TrnContextAtt.AttributeValue)
                    // When inserting with instantiated FORCCod
                    Case &TrnContextAtt.AttributeName = !"FORCCod"
                        &Insert_FORCCod.FromString(&TrnContextAtt.AttributeValue)
                    // When inserting with instantiated PERSNROINT
                    Case &TrnContextAtt.AttributeName = !"PERSNROINT"
                        &Insert_PERSNROINT.FromString(&TrnContextAtt.AttributeValue)
                    // When inserting with instantiated EMPRNUMEMP
                    Case &TrnContextAtt.AttributeName = !"EMPRNUMEMP"
                        &Insert_EMPRNUMEMP.FromString(&TrnContextAtt.AttributeValue)
                Endcase
            Endfor
        Endif
    Endif

	}
	/* Generated by Work With Pattern [End] - Do not change */
    &MONECod=udp(PNU0002)
    &Modo=&Mode
    DCPEFecha.Setfocus()
    &SECTId=&Context.UsuaSectId
EndEvent  // Start

Event After Trn
	/* Generated by Work With Pattern [Start] - Do not change */
	[web]
	{
//	HControllerCC0004.Call(&Mode, DCPECod)
	}
	/* Generated by Work With Pattern [End] - Do not change */
EndEvent

Transaction.Rules:
/* Generated by Work With Pattern [Start] - Do not change */
parm(&Mode, &DCPECod, &DCPELote);

//DCPECod = &DCPECod if not &DCPECod.IsEmpty();
//noaccept(DCPECod) if not &DCPECod.IsEmpty();

noprompt(DCPECod);

// When inserting with CONCCod
CONCCod = &Insert_CONCCod if &Mode = TrnMode.Insert and not &Insert_CONCCod.IsEmpty();
noaccept(CONCCod) if &Mode = TrnMode.Insert and not &Insert_CONCCod.IsEmpty();

// When inserting with MONECod
MONECod = &Insert_MONECod if &Mode = TrnMode.Insert and not &Insert_MONECod.IsEmpty();
noaccept(MONECod) if &Mode = TrnMode.Insert and not &Insert_MONECod.IsEmpty();

// When inserting with FORCCod
FORCCod = &Insert_FORCCod if &Mode = TrnMode.Insert and not &Insert_FORCCod.IsEmpty();
noaccept(FORCCod) if &Mode = TrnMode.Insert and not &Insert_FORCCod.IsEmpty();

// When inserting with PERSNROINT
PERSNROINT = &Insert_PERSNROINT if &Mode = TrnMode.Insert and not &Insert_PERSNROINT.IsEmpty();
noaccept(PERSNROINT) if &Mode = TrnMode.Insert and not &Insert_PERSNROINT.IsEmpty();

// When inserting with EMPRNUMEMP
EMPRNUMEMP = &Insert_EMPRNUMEMP if &Mode = TrnMode.Insert and not &Insert_EMPRNUMEMP.IsEmpty();
noaccept(EMPRNUMEMP) if &Mode = TrnMode.Insert and not &Insert_EMPRNUMEMP.IsEmpty();

/* Generated by Work With Pattern [End] - Do not change */

DCPECod= udp(PNU0001,'MOVPER') If Insert On AfterValidate;
DCPECod =&DCPECod If Not Insert;
DCPELote =&DCPELote If Insert;

Noaccept(DCPECod);
Noaccept(MONECod);
Noaccept(DCPENumLeg);
Noaccept(DCPEFchMod);
Noaccept(DCPEUsrMod);
Noaccept(DCPEAplica);
Noaccept(DCPEFecha) If Not Insert;
Noaccept(DCPETipo) If Not Insert;
Noaccept(DCPECuoCap) If Not Insert;
Noaccept(DCPECuoInt) If Not Insert;
Noaccept(DCPECuoAdm) If Not Insert;
EMPRNUMEMP.Enabled=0 If Not Insert;
PERSNROINT.Enabled=0 If Not Insert;
CONCCod.Enabled=0 If Not Insert;

Default(DCPEFecha,&Today);
Default(MONECod,&MONECod);
Default(DCPEFchAlta,ServerNow());
Default(DCPEUsrAlta,&Context.UsuaCod);
//Default(DCPEEst,'V');
Default(DCPEEst,'S');                       // Solicitado

Serial(DCPECuota,DCPEUltCuo,1);

DCPEFchMod=ServerNow() On afterValidate;
DCPEUsrMod=&Context.UsuaCod On AfterValidate;
DCPEAplica=&Context.UsrAplica On AfterValidate;

DCPENumLeg=PNU0016.Udp(EMPRNUMEMP,PERSNROINT) If Insert And After(PERSNROINT);
//PCC0002.Call(DCPECod) If Insert On AfterComplete;                                                 // Se pas� a proceso WF

&Mes=Month(DCPECuoVto) If Not DCPECuoPor.IsEmpty() And DCPECuoCap.IsEmpty() And After(DCPECuoPor);
&Anio=Year(DCPECuoVto) If Not DCPECuoPor.IsEmpty() And DCPECuoCap.IsEmpty() And After(DCPECuoPor);
&DAPOImpApo=PAP0007.Udp(EMPRNUMEMP,PERSNROINT,&Mes,&Anio) If Not DCPECuoPor.IsEmpty() And DCPECuoCap.IsEmpty() And After(DCPECuoPor);
DCPECuoCap=Round(&DAPOImpApo*DCPECuoPor/100,2) If Not DCPECuoPor.IsEmpty() And DCPECuoCap.IsEmpty() And After(DCPECuoPor);

// Fecha: 12/03/2015
// Se agrega a la siguiente regla que controle para el Att DCPECuoVto (Cuota Vencimiento)
// cuando a parte de ser NULO tambi�n avelue en disparo de error, por el valor VACIO o EMPTY del mismo.
Error('Fecha de Vencimiento Invalida') If (DCPECuoVto.IsNull() OR DCPECuoVto.IsEmpty());
// -----------------------------------------------------------------------------------------------------
Error('Desbe especificar el Tipo de Movimiento') If DCPETipo.IsEmpty();
Error('La Persona ingresada no posee un empleo Activo en la Empresa') If DCPENumLeg.IsEmpty();
Error('El total debe ser superior a cero') If DCPETotal.IsNull() On AfterLevel Level DCPECuoCap;
Error('El importe de la cuota debe ser superior a cero') If DCPECuoTot<=0;
Error('Inserci�n Invalida. No se pueden agregar cuotas') If Insert And Level(DCPECuota) And &Modo=TrnMode.Update;
Error('Eliminaci�n Invalida. No se pueden borrar cuotas') If Delete And Level(DCPECuota) And &Modo=TrnMode.Update;

PCC0010.Call(DCPECod,FORCCod,&Error) If Update And FORCCod.GetOldValue()<>FORCCod On AfterValidate;
PCC0008.Call(DCPECod,DCPECuota,DCPECuoVto,&Error) If Update And Level(DCPECuota) And DCPECuoVto.GetOldValue()<>DCPECuoVto And &Modo=TrnMode.Update On AfterValidate;
Error(&Error.Descripcion) If &Error.Codigo>0 And Update And Level(DCPECuota) On AfterValidate;
Error(&Error.Descripcion) If &Error.Codigo>0 And Update On AfterValidate;

//Prompt(HPromptPE0001,PERSNROINT);
Prompt(HPromptPERSEMPLEO,EMPRNUMEMP,DCPEFecha,PERSNROINT);
//Prompt(HPromptEMPRESAS,EMPRNUMEMP);
NoPrompt(EMPRNUMEMP);

